import { createSlice } from "@reduxjs/toolkit";

export const userSlice = createSlice({
  name: "user",
  initialState: {
    email: "",
    password: "",
    firstName: "",
    lastName: "",
    userName: "",
  },
  reducers: {
    login: () => {},
    signUp: () => {},
    editProfile: () => {},
  },
});

export const { login, signUp, editProfile } = userSlice.actions;

export default userSlice.reducer;
